import React from "react";
import { Link } from "react-router-dom";
import { Button, Card } from "react-bootstrap";

const Product = (props) => {
  const { name, price, wieght, category, description, img } = props;

  return (
    <Card className="my-3 p-3 rounded">
      <Link to={`/product/`}>
        <Card.Img className="product-img" height="89" src={img} variant="top" />
      </Link>

      <Card.Body>
        <Link to={`/product/`}>
          <Card.Title as="div">
            <strong>{name}</strong>
          </Card.Title>
        </Link>

        <Card.Text as="span">{wieght}</Card.Text>
        <Card.Text as="span">{price}</Card.Text>
        <Card.Text as="p">{category}</Card.Text>
        <Card.Text as="p">{description}</Card.Text>

        <button className="btn btn-primary">Add to Cart</button>
      </Card.Body>
    </Card>
  );
};

export default Product;
